Here's a simple Python function that prints the first 100 prime numbers:
```python
def print_primes():
    for i in range(1, 101):
        if (i % 2 == 0) == False:
            print(i)
```
This uses a simple brute-force approach to check if each number up to 100 is prime. The loop iterates over the numbers from 1 to 100, and for each number, it checks if it's divisible by any number less than 100 (i.e., by 2, 3, 4, 5, 6, 7, 8, 9). If the number is not divisible by any of those numbers, it's a prime and the loop prints it.

This is a very simple and inefficient algorithm, as it checks each number sequentially, which takes O(n) time. A more efficient algorithm would be to use a sieve of Eratosthenes, which only checks divisibility up to a certain threshold depending on the number being tested (in this case, up to 9 since we only want to find prime numbers up to 100). The time complexity of this algorithm is O(n log log n), which is much more efficient than the brute-force approach.

