Here is a function that rescales a 64-bit BigInt to a double between 0 (inclusive) and 1 (exclusive):

```js
function rescaleBigIntTo01(bigInt) {
  const max = 2n ** 64n - 1n;
  const ratio = Number(bigInt) \/ Number(max);
  return ratio;
}
```

To explain:

- The maximum 64-bit BigInt is 2^64 - 1, which is calculated as 2n ** 64n - 1n. This will be the divisor.

- We convert the BigInt to a Number so we can do floating point division.

- We divide the BigInt by the max BigInt to get a ratio between 0 and 1. 

- We return the ratio as a double.

So this takes any 64-bit BigInt, divides it by the max possible 64-bit BigInt, and returns the floating point result between 0 and 1.

