- This value is stored in maxBigInt.
- bigNum is divided by maxBigInt to rescale it between 0 and 1. Since BigInt division returns a BigInt, it is implicitly converted to a double when returned.

So this function takes any 64-bit BigInt as input, rescales it proportionally between 0 and 1, and returns the result as a double precision floating point number.

