Yes, you can find out how many queries were made during a session with NHibernate by using the `Statistics` object provided by NHibernate.

Here is how you can do it:

1. Instantiate the `Statistics` object before starting the session.
```csharp
Statistics stats = new Statistics();
```
2. Assign the `Statistics` object to the `Statistics` property of the `Session` object before starting the session.
```csharp
using (ISession session = sessionFactory.OpenSession())
{
    session.EnableFilter("statistics").Statistics = stats;

    \/\/ Your session operations here
}
```
3. After the session operations are completed, you can call the `GetQueryCount` method of the `Statistics` object to get the number of queries executed during the session.
```csharp
int queryCount = stats.QueryCount;
```
Note that enabling the `statistics` filter in the session configuration will log query statistics, including the number of queries executed, the number of fetched entities, and the total query execution time. This information can be accessed through the `Statistics` object.

response_b:
Yes, NHibernate provides a way to track the number of queries executed during a session. Here are a few options:

- Use the Statistics() method on the ISession interface. This will return an IStatistics implementation that has properties like QueryCount that show metrics about the session.

```csharp
var stats = session.Statistics;
int queryCount = stats.QueryCount;
```

- Implement an IInterceptor and count queries in the OnPrepareStatement() method. 

```csharp 
public class QueryCountingInterceptor : IInterceptor
{
  private int _queryCount;

  public void OnPrepareStatement(SqlString sql, IDictionary<string, IParameterSpecification> paramSpecs)
  {
    _queryCount++;
  }

  public int QueryCount => _queryCount;
}
```

- Use a profiling\/logging tool like NHibernate Profiler that can track and display query counts for sessions.

So in summary, the Statistics() method gives you query counts directly from the session, while an interceptor or profiler can provide more detailed tracking of queries executed. This is useful for monitoring performance and optimizing queries.
